function showData(t){for(t.sort(function(t,i){return i.details.nmi-t.details.nmi}),i=0;i<t.length;i++)rankHtml="<td>"+(i+1)+"</td>",groupHtml="<td>"+t[i].group+"</td>",nmiHtml="<td>"+t[i].details.nmi+"</td>",ancHtml="<td>"+t[i].details.anc+"</td>",timeHtml="<td>"+t[i].details.latest_time+"</td>",countHtml="<td>"+t[i].details.total_count+"</td>",$("#tableNMI").append("<tr>"+rankHtml+groupHtml+nmiHtml+ancHtml+timeHtml+countHtml+"</tr>");for(t.sort(function(t,i){return i.details.anc-t.details.anc}),i=0;i<t.length;i++)rankHtml="<td>"+(i+1)+"</td>",groupHtml="<td>"+t[i].group+"</td>",nmiHtml="<td>"+t[i].details.nmi+"</td>",ancHtml="<td>"+t[i].details.anc+"</td>",timeHtml="<td>"+t[i].details.latest_time+"</td>",countHtml="<td>"+t[i].details.total_count+"</td>",$("#tableANC").append("<tr>"+rankHtml+groupHtml+nmiHtml+ancHtml+timeHtml+countHtml+"</tr>")}function sortNMI(){$("#tableNMI").show(),$("#tableANC").hide()}function sortANC(){$("#tableANC").show(),$("#tableNMI").hide()}$(document).ready(function(){$.ajax({url:"/online_judge/rank_list/",type:"GET",dataType:"json",complete:function(t,i,l){if(200===t.status){var n=JSON.parse(t.responseText);showData(n)}else alert(t.status)}})});